import styled from 'styled-components';

const CTA= ({link, txt}) => (
    <Wrapper>
        <a href={link}>{txt}</a>
    </Wrapper>
);


const Wrapper = styled.section`
 background-color:#E54B4B;
 height:5.875rem;
 width:30.1875rem;
 border-radius:10px;
 border:none;
 a{
    display:flex;
justify-content:center;
align-items:center;
 color:white;
 font-size:28px;
 font-weight:700;
 }
`

export default CTA;
